    "cape-newenham-national-wildlife-refuge-narrative-report-january-1-to-december-31-1969",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Cape Newenham
    NWR (now part of Togiak NWR) outlines Refuge accomplishments during the 1969 calendar
    year. The report begins by summarizing the weather conditions and habitat conditions
    during the year. Wildlife- including migratory birds, mammals, and fish- is also
    covered. The Refuge development and maintenance section discusses physical developments.
    Resource management is outlined; topics include commercial fishing. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, hunting, and fishing. Photographs
    are attached.",nt"license_title": "License Not Specified",nt"extras":
